import React, { useState } from 'react';

const App4 = () => {
    let newTime = new Date().toLocaleTimeString();
    

    const NewTime = () => {
        
        const [newTime, setnewTime] = useState(newTime);
        let currentTime = new Date().toLocaleTimeString();
        setnewTime(currentTime);
    }
    return (
        <>
            
            <h1>{newTime} Time</h1>
            <button>Get Time</button>
            </>
    );
}

export { App4 };
